import React, { useState } from "react";
import Sidebar from "./components/Sidebar/Sidebar";
import AdminDashboard from "./components/Dashboard/AdminDashboard";
import FleetManagement from "./components/FleetManagement/FleetManagement";
import OilManagement from "./components/OilManagement/OilManagement";
import UserManagement from "./components/UserManagement/UserManagement";
import CityOperation from "./components/CityOperation/Cityoperation";
// import Analytics, Settings, Login if needed

const serviceComponents = {
  dashboard: <AdminDashboard />,
  fleet: <FleetManagement />,
  oil: <OilManagement />,
  user: <UserManagement />,
  city: <CityOperation />,
  // Add analytics, settings components likewise
};

export default function App() {
  const [activeService, setActiveService] = useState('dashboard');
  return (
    <div className="app-wrapper">
      <Sidebar onSelect={setActiveService} activeKey={activeService} />
      <main style={{ flex: 1 }}>
        {serviceComponents[activeService] ?? <AdminDashboard />}
      </main>
    </div>
  );
}
